export const shippingProvider = [
  {
    image: '/images/dhl.png',
    name: "DHL Express",
    type: "express",
    expectArrive: 3,
    cost: 5.00,
  },
  {
    image: '/images/j&t.png',
    name: "J&T Express",
    type: "express",
    expectArrive: 4,
    cost: 6.04,
  },
  {
    image: '/images/ninjavan.png',
    name: "Ninja Van",
    type: "standard",
    expectArrive: 5,
    cost: 5.50,
  },
];
